    let names = props.finalGuesses.map((player) => {return Object.keys(player)})
    return (
        <div className = "game-over">
            {props.finalGuesses.map((player, index) => (
                <div key = {index}>
                <div className = "name">{names[index]}</div>
                <div className = "guess">{player[names[index]]}</div>
                </div>
                )
            )}
        </div>

    )
}

export default GameOver;
